    function addPricingSection(target) {
        try {
            target.insertAdjacentHTML('afterend', pricingHTML);

              

            addSwiper();
            scrollToForm();
        } catch (error) {
            console.error('Error inserting pricing section:', error);
        }
    }

    function observePricingSection(target) {
        const observer = new MutationObserver(function (mutations) {
            mutations.forEach(function (mutation) {
                if (!document.querySelector('.pricing')) {
                    addPricingSection(target);
                }
            });
        });

        observer.observe(target.parentElement, { childList: true, subtree: true });
    }

    function addSwiper() {
        const swiperCSS = document.createElement('link');
        swiperCSS.rel = 'stylesheet';
        swiperCSS.href = 'https://unpkg.com/swiper/swiper-bundle.min.css';
        document.head.appendChild(swiperCSS);

        const swiperJS = document.createElement('script');
        swiperJS.src = 'https://unpkg.com/swiper/swiper-bundle.min.js';
        swiperJS.onload = function () {
            let swiper;
            let observer;

            function initializeSwiper(entries) {
                entries.forEach(entry => {
                    if (entry.isIntersecting && !swiper && window.innerWidth > 767) {
                        swiper = new Swiper('.swiper-container', {
                            direction: 'horizontal',
                            slidesPerView: 'auto',
                            spaceBetween: 20,
                            breakpoints: {
                                1421: {
                                    slidesPerView: 4,
                                },
                            },
                        });
                    }
                });
            }

            function createObserver() {
                observer = new IntersectionObserver(initializeSwiper, {
                    root: null, 
                    threshold: 0.1 
                });
                const swiperContainer = document.querySelector('.swiper-container');
                if (swiperContainer) {
                    observer.observe(swiperContainer);
                }
            }

            function destroySwiper() {
                if (swiper) {
                    swiper.destroy(true, true);
                    swiper = null;
                }
                if (observer) {
                    observer.disconnect();
                    observer = null;
                }
            }

            function handleResize() {
                if (window.innerWidth < 768 && swiper) {
                    destroySwiper();
                }

                if (window.innerWidth > 767 && !swiper) {
                    createObserver();
                }
            }

            createObserver();
            window.addEventListener('resize', handleResize);
        };
        document.body.appendChild(swiperJS);
    }
    function scrollToForm() {
        const buttons = document.querySelectorAll('.pricing .pricingHeaderSlider button');
        const currentPageUrl = window.location.pathname;
    
        buttons.forEach(function(button) {
            button.addEventListener('click', function() {
                if (currentPageUrl.includes('/deel-vs-competitors/')) {
                    window.location.href = 'https://www.deel.com/request-a-demo/';
                } else {
                    window.scrollTo({
                        top: 0,
                        behavior: 'smooth'
                    });
                }
            });
        });
    }
    
    
    

