function initializeTabs() {
  const tabs = document.querySelectorAll('.tabcordion--tabs .acc-tab');
  const items = document.querySelectorAll('.tabcordion--entry');
  const heroWrapper = document.querySelector('.hero-wrapper');

  tabs.forEach((tab, index) => {
    tab.addEventListener('click', () => {
      toggleClass(tabs, tab);
      toggleClass(items, items[index]);
      updateActiveSvg(index, heroWrapper);
    });
  });

  window.addEventListener('resize', () => {
    const activeTabIndex = [...tabs].findIndex(tab => tab.classList.contains('is-active'));
    updateActiveSvg(activeTabIndex, heroWrapper);
  });

  const activeTabIndex = [...tabs].findIndex(tab => tab.classList.contains('is-active'));
  updateActiveSvg(activeTabIndex, heroWrapper);
}

function updateActiveSvg(activeTabIndex, heroWrapper) {
  if (!heroWrapper) {
    return; 
  }

  const svgs = document.querySelectorAll('.hero-wrapper svg');
  const currentScreenSize = getCurrentScreenSize();

  svgs.forEach((svg) => svg.classList.remove('is-active'));

  const svgClassNameMap = ['hiring', 'hr', 'it', 'immigration'];
  const svgClassToActivate = svgClassNameMap[activeTabIndex];

  const svgSelector = `.${svgClassToActivate}.${currentScreenSize}`;
  const activeSvg = document.querySelector(svgSelector);

  if (activeSvg) {
    activeSvg.classList.add('is-active');
  }

  heroWrapper.classList.remove('hiring-active', 'payroll-active', 'hr-active', 'it-active', 'immigration-active');
  const heroWrapperClass = `${svgClassToActivate}-active`;
  heroWrapper.classList.add(heroWrapperClass);
}

function getCurrentScreenSize() {
  if (window.innerWidth > 959) {
    return 'desktop';
  } else if (window.innerWidth >= 420 && window.innerWidth <= 958) {
    return 'tab';
  } else {
    return 'mob';
  }
}

function toggleClass(elems, activeElem) {
  elems.forEach((elem) => {
    elem.classList.remove('is-active');
  });
  activeElem.classList.add('is-active');
}

