        var all_contries_arr = [];

        function capitalizeFirstLetter(string) {
          return string.charAt(0).toUpperCase() + string.slice(1);
        }

        // Create Custom Dropdown
        function createCustomDropdown(dropdown) {

            const options = dropdown.querySelectorAll("option");
            let optionsArr = Array.prototype.slice.call(options);

            //optionsArr = optionsArr.sort((a, b) => a.textContent.localeCompare(b.textContent));
          optionsArr = optionsArr.sort((a, b) => {
    				if (a.textContent === "Country") return -1; // Keep "Country" first
            if (b.textContent === "Country") return 1;  // Move other items after "Country"
            return a.textContent.localeCompare(b.textContent); // Alphabetical sort for the rest
        });

            const customDropdown = document.createElement("div");
            customDropdown.classList.add("dropdown");
            dropdown.insertAdjacentElement("afterend", customDropdown);

            const selected = document.createElement("div");
            selected.classList.add("dropdown-select");
            selected.textContent = optionsArr[0].textContent;
            customDropdown.appendChild(selected);

            const menu = document.createElement("div");
            menu.classList.add("dropdown-menu");
            customDropdown.appendChild(menu);
            selected.addEventListener("click", toggleDropdown.bind(menu));

            // Create Search Input Element
            const search = document.createElement("input");
            search.placeholder = "Search...";
            search.type = "text";
            search.classList.add("dropdown-menu-search");
            menu.appendChild(search);

            const menuInnerWrapper = document.createElement("div");
            menuInnerWrapper.classList.add("dropdown-menu-inner");
            menu.appendChild(menuInnerWrapper);

            var seen = [];

            optionsArr.forEach((option) => {
                if (seen.includes(option.textContent)) {
                    return; // Skip if the option is already seen (duplicate)
                }
                seen.push(option.textContent);
                const item = document.createElement("div");
                item.classList.add("dropdown-menu-item");
                item.dataset.value = option.value;
                item.textContent = option.textContent;
                menuInnerWrapper.appendChild(item);

                item.addEventListener(
                    "click",
                    setSelected.bind(item, selected, dropdown, menu)
                );
            });

            menuInnerWrapper.querySelector("div").classList.add("selected");

            search.addEventListener("input", filterItems.bind(search, optionsArr, menu));
            document.addEventListener(
                "click",
                closeIfClickedOutside.bind(customDropdown, menu)
            );
            dropdown.style.display = "none";

            // Attach arrow key navigation to search input
             search.addEventListener("keydown", (e) => handleArrowNavigation(e, menuInnerWrapper, selected, dropdown, menu, search));

        }

        // Toggle for Display and Hide Dropdown
        function toggleDropdown() {
            if (this.offsetParent !== null) {
                this.style.display = "none";
                document.querySelector('.spz_t8007 .input-group').classList.remove('select-open');
            } else {
                this.style.display = "block";
                this.querySelector("input").focus();
                document.querySelector('.spz_t8007 .input-group').classList.add('select-open');
            }
        }

        // document.querySelector('.spz_t8007 .input-wrapper .form-arrow').addEventListener('click', function() {
        //     document.querySelector('.spz_t8007 .input-wrapper').classList.toggle('dropdown-show');
        // });

        // Open dropdown on button click
        document.querySelector('.spz_t8007 .input-wrapper .form-arrow').addEventListener('click', function(event) {
            event.stopPropagation();

            const dropdown = this.closest('.spz_t8007').querySelector('.input-wrapper .form-arrow');
            const dropdownMenu = this.closest('.spz_t8007').querySelector('.dropdown-menu');

            if (dropdownMenu.style.display === "block") {
                dropdownMenu.style.display = "none";
                document.querySelector('.spz_t8007 .input-group').classList.remove('select-open');
            } else {
                dropdownMenu.style.display = "block";
                dropdownMenu.querySelector("input").focus();
                document.querySelector('.spz_t8007 .input-group').classList.add('select-open');
            }
        });

        // Close dropdown if clicked outside of it
        document.addEventListener('click', function(event) {
            const dropdown = document.querySelector('.spz_t8007');
            if (!dropdown.contains(event.target)) { 
                const dropdownMenu = dropdown.querySelector('.dropdown-menu');
                if (dropdownMenu.style.display === "block") {
                    dropdownMenu.style.display = "none";
                    document.querySelector('.spz_t8007 .input-group').classList.remove('select-open');
                }
            }
        });

        // Set Selected Option
        function setSelected(selected, dropdown, menu) {
            // Get Value and Label from Clicked Custom Option
            const value = this.dataset.value;
            const label = this.textContent;

              document.querySelector(".dropdown-select").innerHTML = value;
              document.querySelector('body').classList.remove("show-line");
              if(all_contries_arr[value]['has_payroll_support'] === true){
                    document.querySelector('body').classList.add("has_payroll_support");
                    document.querySelector('body').classList.remove("not_has_payroll_support");
                } else {
                    document.querySelector('body').classList.remove("has_payroll_support");
                    document.querySelector('body').classList.add("not_has_payroll_support");
                }

            selected.textContent = label;
            dropdown.value = value;
            
            menu.style.display = "none";

            document.querySelector('.spz_t8007 .input-group').classList.remove('select-open');

            menu.querySelector("input").value = "";
            menu.querySelectorAll("div").forEach((div) => {
                if (div.classList.contains("is-select")) {
                    div.classList.remove("is-select");
                }
                if (div.offsetParent === null) {
                    div.style.display = "block";
                }
            });
            this.classList.add("is-select");
        }

        // Filter the Items
        function filterItems(itemsArr, menu) {
            const customOptions = menu.querySelectorAll(".dropdown-menu-inner div");
            const value = this.value.toLowerCase();
            const filteredItems = itemsArr.filter((item) =>
                item.value.toLowerCase().includes(value)
            );
            const indexesArr = filteredItems.map((item) => itemsArr.indexOf(item));

            itemsArr.forEach((option) => {
                if (!indexesArr.includes(itemsArr.indexOf(option))) {
                    customOptions[itemsArr.indexOf(option)].style.display = "none";
                    document.querySelector('.spz_t8007 .input-group').classList.remove('select-open');
                } else {
                    if (customOptions[itemsArr.indexOf(option)].offsetParent === null) {
                        customOptions[itemsArr.indexOf(option)].style.display = "block";
                    }
                }
            });
        }

        // Function to handle arrow key navigation
        function handleArrowNavigation(e, menuInnerWrapper, selected, dropdown, menu, search) {
           const visibleItems = Array.from(menuInnerWrapper.querySelectorAll(".dropdown-menu-item"))
              .filter((item) => item.offsetParent !== null);
           let currentIndex = visibleItems.findIndex(item => item.classList.contains("highlighted"));
           
           if (e.key === "ArrowDown") {
              e.preventDefault();
              currentIndex = (currentIndex + 1) % visibleItems.length;
              highlightItem(visibleItems, currentIndex);
           } else if (e.key === "ArrowUp") {
              e.preventDefault();
              currentIndex = (currentIndex - 1 + visibleItems.length) % visibleItems.length;
              highlightItem(visibleItems, currentIndex);
           } else if (e.key === "Enter" && currentIndex >= 0) {
              e.preventDefault();
              visibleItems[currentIndex].click();
              search.blur(); // Blur search input to prevent accidental key presses
           }
        }

        // Function to highlight an item in the dropdown
        function highlightItem(items, index) {
           items.forEach((item) => item.classList.remove("highlighted"));
           items[index].classList.add("highlighted");
        }

        // Close Dropdown if Clicked Outside Dropdown Element
        function closeIfClickedOutside(menu, e) {
            if (
                e.target.closest(".dropdown") === null &&
                e.target !== this &&
                menu.offsetParent !== null
            ) {
                menu.style.display = "none";
              document.querySelector('.spz_t8007 .input-group').classList.remove('select-open');
            }
        }

        
