function placeholder() {

		if (window.matchMedia('(max-width: 767px)').matches) {
      var wait_for_span = setInterval(function () {
        if (document.querySelector('.form-content .hs-form .hs_in_which_countries_would_you_like_to_run_payroll_.hs-form-field > label span') != null) {
          clearInterval(wait_for_span);
          document.querySelector('.form-content .hs-form .hs_in_which_countries_would_you_like_to_run_payroll_.hs-form-field > label span').innerHTML = "Countries to run payroll";
        }
      });
    } else {
      var wait_for_span1 = setInterval(function () {
        if (document.querySelector('.form-content .hs-form .hs_in_which_countries_would_you_like_to_run_payroll_.hs-form-field > label span') != null) {
          clearInterval(wait_for_span1);
          document.querySelector('.form-content .hs-form .hs_in_which_countries_would_you_like_to_run_payroll_.hs-form-field > label span').innerHTML = "In which countries would you like to run payroll?";
        }
      });
    }

    // Ensure correct styles for the button to be fully accessible
    var wait_for_button = setInterval(function () {
        var button = document.querySelector('.get-pricing');
        if (button != null && button.offsetWidth > 0 && button.offsetHeight > 0) {
            clearInterval(wait_for_button);

            // Ensure the button is clickable with pointer events and z-index adjustments
            button.style.pointerEvents = "auto";
            button.style.cursor = "pointer";
            button.style.zIndex = "1000";
            button.style.display = "block"; // Ensure its visible on mobile

            // Attach event listener for both click and touch
            button.addEventListener('click', function (event) {
                event.preventDefault();
                window.location.href = "https://www.deel.com/pricing/"; 
            });

            button.onclick = function () {
                window.location.href = "https://www.deel.com/pricing/";
            };
            
            console.log("Pricing button event listeners successfully set.");
        }
    }, 100);
}


