function detect_browser() {
	let browser_class = '';
	if ((navigator.userAgent.indexOf("Opera") || navigator.userAgent.indexOf('OPR')) != -1) {
		browser_class = 'spz-opera';
	} else if (navigator.userAgent.indexOf("Edg") != -1) {
		browser_class = 'spz-edge';
	} else if (navigator.userAgent.indexOf("Chrome") != -1) {
		browser_class = 'spz-chrome';
	} else if (navigator.userAgent.indexOf("Safari") != -1) {
		browser_class = 'spz-safari';
	} else if (navigator.userAgent.indexOf("Firefox") != -1) {
		browser_class = 'spz-firefox';
	} else if ((navigator.userAgent.indexOf("MSIE") != -1) || (!!document.documentMode === true)) {
		browser_class = 'spz-ie';
	}
	document.querySelector('body').classList.add(browser_class);
}

function detectOS() {
	var userAgent = window.navigator.userAgent,
	platform = window.navigator.platform,
	macosPlatforms = ['Macintosh', 'MacIntel', 'MacPPC', 'Mac68K'],
	windowsPlatforms = ['Win32', 'Win64', 'Windows', 'WinCE'],
	iosPlatforms = ['iPhone', 'iPad', 'iPod'],
	os = null;

	if (macosPlatforms.indexOf(platform) !== -1) {
		os = 'MacOS';
	} else if (iosPlatforms.indexOf(platform) !== -1) {
		os = 'iOS';
	} else if (windowsPlatforms.indexOf(platform) !== -1) {
		os = 'Windows';
	} else if (/Android/.test(userAgent)) {
		os = 'Android';
	} else if (!os && /Linux/.test(platform)) {
		os = 'Linux';
	}

	document.querySelector('body').classList.add(os);
	return os;
}

function initializeScript() {
	const body = document.querySelector('body');
	if (body && (!body.classList.contains('deel_1040_v2') || document.querySelector(".MuiBox-root.hero-right") == null)) {
		urlCheck();
		addClassToBody();
		addDemoCta();
	}
}
window.addEventListener('load', initializeScript);
window.addEventListener('pageshow', (event) => {
  if (event.persisted) {
    console.log('Page restored from cache.');
  }
  initializeScript();
});
