history.pushState = (function (f) {
  return function pushState() {
    var ret = f.apply(this, arguments);
    window.dispatchEvent(new Event("pushstate"));
    window.dispatchEvent(new Event("locationchange"));
    return ret;
  };
})(history.pushState);

history.replaceState = (function (f) {
  return function replaceState() {
    var ret = f.apply(this, arguments);
    window.dispatchEvent(new Event("replacestate"));
    window.dispatchEvent(new Event("locationchange"));
    return ret;
  };
})(history.replaceState);

window.addEventListener("popstate", function () {
  window.dispatchEvent(new Event("locationchange"));
});

window.addEventListener("locationchange", function () {
  url = location.href || '';
  urlCheck(url);
  addClassToBody();
});

function isSameUrl(currentUrl, specifiedUrl, includeQueryParams) {
  currentUrl = currentUrl || '';
  specifiedUrl = specifiedUrl || '';

  currentUrl = currentUrl.includes("#") ?
    currentUrl.slice(0, currentUrl.indexOf("#")) :
    currentUrl;
  specifiedUrl = specifiedUrl.includes("#") ?
    specifiedUrl.slice(0, specifiedUrl.indexOf("#")) :
    specifiedUrl;

  if (!includeQueryParams) {
    currentUrl = currentUrl.includes("?") ?
      currentUrl.slice(0, currentUrl.indexOf("?")) :
      currentUrl;
  }
  return currentUrl === specifiedUrl || currentUrl === specifiedUrl + "/";
}

function urlCheck(url) {
  var allblogsurlstring = "https://www.deel.com/";
  if (window.location.pathname === "/" || window.location.pathname.indexOf("/request-a-demo") > -1) {
    allblogsurlstring = window.location.href || '';
  }
  if (isSameUrl(url, allblogsurlstring, true)) {
    var bodyIntervalInit = setInterval(function () {
      var bodyElement = document.querySelector('body');
      if (bodyElement) {
        clearInterval(bodyIntervalInit);
        var OStype = detectOS();
        if (OStype === 'MacOS' || OStype === 'iOS') {
          if (!bodyElement.classList.contains('spz-apple-os')) {
            bodyElement.classList.add('spz-apple-os');
            addClassToBody();
          }
        }
        detect_browser();
        addClassToBody();
      }
    }, 100);
  }
}

